// File f = new file(URL.createObjectURL(file))
// File f = new File("hbbbb")
import fs from 'node:fs'

// let url = "ghcgjhhcghcg"

export const copyFile = (url) => {

    fs.readFile(url, 'uyf8', (err, data) => {
        if (err) {
            console.error(err)
        }
        else {
            alert(data)
        }
    })

}
